import React from 'react';

const Header = () => {
  const headerStyle = {
    color: 'blue',
    fontStyle: 'Univers',
    fontSize: 32
  }

  return (
    <div style={headerStyle}>
      <br />
      <em>Puhelinluettelo</em>
    </div> 
  )
}

export default Header;
